import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type a query
    await page.waitForSelector('.search-input');
    await page.fill('.search-input', 'jun');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_search.png'));

    // Click the search button and wait for results to load
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Wait for the search results header to appear
    await page.waitForSelector('.search-header h2', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract the number of results and titles of the first 3 results
    const extractedData = {};
    extractedData.searchHeader = await page.textContent('.search-header h2');
    extractedData.resultCount = await page.textContent('.search-header p');
    extractedData.topResults = await page.$$eval('.search-result-item .result-title', nodes =>
      nodes.slice(0, 3).map(n => n.textContent.trim())
    );

    // Click on the first search result
    const firstResult = await page.$('.search-result-item');
    if (firstResult) {
      await firstResult.click();
      // Wait for video player title to appear
      await page.waitForSelector('.video-title', { timeout: 5000 });
      // Take screenshot of video player page
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_video_player.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_video_player.png'));
      // Extract video title and channel name
      extractedData.videoTitle = await page.textContent('.video-title');
      extractedData.channelName = await page.textContent('.channel-name');
    }

    // Interact with the "Like" button
    await page.waitForSelector('.like-btn');
    const likeBtn = await page.$('.like-btn');
    const likeCountBefore = await likeBtn.$eval('span', el => el.textContent);
    await likeBtn.click();
    // Wait for the like button to become active
    await page.waitForSelector('.like-btn.active', { timeout: 2000 });
    const likeCountAfter = await likeBtn.$eval('span', el => el.textContent);
    extractedData.likeCountBefore = likeCountBefore;
    extractedData.likeCountAfter = likeCountAfter;
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_liked_video.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_liked_video.png'));

    // Scroll to comments section and extract the first comment
    await page.waitForSelector('.comments-list .comment', { timeout: 5000 });
    await page.evaluate(() => {
      document.querySelector('.comments-list').scrollIntoView();
    });
    await page.waitForTimeout(500);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_comments.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_comments.png'));

    const firstComment = await page.$('.comments-list .comment');
    if (firstComment) {
      extractedData.firstComment = await firstComment.$eval('.comment-text', el => el.textContent.trim());
      extractedData.firstCommentAuthor = await firstComment.$eval('.comment-author', el => el.textContent.trim());
    }

    // Click on the "Library" nav item using text selector
    const libraryNav = await page.$('a.nav-item:text("Library")');
    if (libraryNav) {
      await libraryNav.click();
    } else {
      // Fallback: use data-page attribute if available
      const navs = await page.$$('a.nav-item');
      for (const nav of navs) {
        const text = await nav.textContent();
        if (text && text.trim().toLowerCase() === 'library') {
          await nav.click();
          break;
        }
      }
    }
    // Wait for library page to load
    await page.waitForSelector('.page-header h1', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_library.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_library.png'));

    // Extract the names of the first 2 playlists (if any)
    extractedData.libraryPlaylists = await page.$$eval('.playlist-card .playlist-info h4', nodes =>
      nodes.slice(0, 2).map(n => n.textContent.trim())
    );

    return {
      success: true,
      action: "Searched for 'jun', navigated to a video, liked it, extracted data, and visited Library.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
